import React from 'react'

function SeeAll(props) {
    let content = props.list.map(ele=>{
        return <div className='app' key={ele.id}>
            <li>{ele.name}</li>
            <p></p>
        </div>
    })

  return (
    <div>
        <ul>

        </ul>
    </div>
  )
}

export default SeeAll
